import React from "react";
import "./RecommandedVideos.css";
import VideoCard from "./VideoCard";

function RecommandedVideos() {
  return (
    <div class="recommandedVideos">
      <h2>Recommanded</h2>
      <div className="recommandeVideos_video"></div>
      <VideoCard
        title="Learn adn grow"
        views="5.5M Views"
        timeStamp="2 days ago"
        channelImage="https://upload.wikimedia.org/wikipedia/commons/thumb/9/98/YouTube_Logo.svg/512px-YouTube_Logo.svg.png"
      ></VideoCard>
    </div>
  );
}

export default RecommandedVideos;
